import sys
import threading

polymers = ""

sys.setrecursionlimit(10000)

def react(polymers, reactedPolymers, i):
 for idx, unit in enumerate(polymers):
      if(unit.islower()):
        if((idx) < len(polymers)-1):
          if(unit.upper() == polymers[idx+1]):
              polymers = polymers[:idx] + polymers[(idx+2):]
              react(polymers, reactedPolymers, i)
              return
      elif unit.isupper():
          if((idx) < len(polymers)-1):
             if(unit.lower() == polymers[idx+1]):
                polymers = polymers[:idx] + polymers[(idx+2):]
                react(polymers, reactedPolymers, i)
                return
 reactedPolymers.extend('')               
 reactedPolymers[i] = polymers

def reactFinal(polymers, reactedPolymers, n):
 for idx, unit in enumerate(polymers):
      if(unit.islower()):
        if((idx) < len(polymers)-1):
          if(unit.upper() == polymers[idx+1]):
              polymers = polymers[:idx] + polymers[(idx+2):]
              reactFinal(polymers, reactedPolymers, n)
              return
      elif unit.isupper():
          if((idx) < len(polymers)-1):
             if(unit.lower() == polymers[idx+1]):
                polymers = polymers[:idx] + polymers[(idx+2):]
                reactFinal(polymers, reactedPolymers, n)
                return
 reactedPolymers[n] = polymers

   
def asyncReact(polymers, n):
    threads = []
    j = 0
    reactedPolymers = [''] * 1000
    for i in range(0, len(polymers), n):
        
        thr = threading.Thread(target=react, args=[polymers[i:i+n], reactedPolymers, j])
        thr.start()
        threads.append(thr)
        j += 1
        
    for process in threads:
        process.join()
    
    finalReactedPolymers = [''] * 10
    reactFinal(''.join(reactedPolymers), finalReactedPolymers, 1)
    print(len(finalReactedPolymers[1]))
    reactFinal(finalReactedPolymers[1], finalReactedPolymers, 2)   
    print(len(finalReactedPolymers[2])) 


